import React ,{useState} from 'react';
import  ReactDOM  from 'react-dom/client';
import './index.css';
import App from './App';

function Car(props){
  return(
    <>
      <li>I am a {props.brand}</li>
    </>

  );
}

function  Garage(){
  const cars =[
    {brand : 'Ribbon' , id : 1} ,
    { brand : 'Toyota corolla', id : 2} ,
    { brand : 'MG hs', id : 3}
   ]

  return(
    <>
      <h1>Who live here</h1>
      <ul>
       {cars.map((car) => <Car brand = {car.brand}/>)}
      </ul>
    </>
  );
}
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  // <React.StrictMode>
